import React from 'react';
import Header from './components/Header';
import Home from './components/Home';
import Papers from './components/Papers';
import Registration from './components/Registration';
import Venue from './components/Venue';
import Speakers from './components/Speakers';
import OrganizingCommittee from './components/OrganizingCommittee';
import ImportantDates from './components/ImportantDates';
import AboutPrayagraj from './components/AboutPrayagraj';
import Sponsors from './components/Sponsors';
import Footer from './components/Footer';
import { ScrollToTop, ProgressBar } from './components/InteractiveElements';
import { FloatingActionButton } from './components/InteractiveFeatures';
import './App.css';

function App() {
  const fabActions = [
    {
      icon: '📧',
      title: 'Contact Us',
      onClick: () => window.location.href = 'mailto:confpharm@uniteduniversity.edu.in'
    },
    {
      icon: '📞',
      title: 'Call Us',
      onClick: () => window.location.href = 'tel:+91-532-123-4567'
    },
    {
      icon: '📍',
      title: 'Location',
      onClick: () => document.getElementById('venue').scrollIntoView({ behavior: 'smooth' })
    },
    {
      icon: '📝',
      title: 'Register',
      onClick: () => document.getElementById('registration').scrollIntoView({ behavior: 'smooth' })
    }
  ];

  return (
    <div className="App">
      <ProgressBar />
      <Header />
      <Home />
      <Papers />
      <Registration />
      <Venue />
      <Speakers />
      <OrganizingCommittee />
      <ImportantDates />
      <AboutPrayagraj />
      <Sponsors />
      <Footer />
      <ScrollToTop />
      <FloatingActionButton actions={fabActions} />
    </div>
  );
}

export default App;
